import Vue from 'vue';
import App from './App.vue';
import VueRouter from 'vue-router';
import { Routes } from './router/index';
const router = new VueRouter({
  routes: Routes,
  mode: "history"
});
Vue.config.productionTip = false;
Vue.use(VueRouter);
new Vue({
  router: router,
  render: h => h(App)
}).$mount('#app');
